import { BrowserRouter, Routes, Route } from "react-router-dom";
import { LinksBar, Navbar } from "./components/Navbar";
import { Main } from "./components/Main";
import {
  Contacts,
  HodovayaFix,
  AutoDiagnostic,
  Engine,
  TehService,
  OtherServices,
  AutoConditioner,
  TireFitting,
  Rozval,
  TehFluids,
  BrakSystem,
  Steering,
} from "./components/SimpleLinks";
import { Footer } from "./components/Footer";
import { CommentForm } from "./components/Comments";
import ScrollToTop from "./components/ScrollToTop";
import React, { useEffect, useState } from "react";
import { Link, useLocation } from "react-router-dom";
import Services from "./components/SimpleLinks/Services";

const AppRoutes = ({ href }) => {
  const [service_path, setService_path] = useState("");
  const [windowLocHref, setWindowLocHref] = useState("");
  const [windowPath, setWindowPath] = useState("");
  console.log(windowLocHref);

  useEffect(() => {
    let window_location = "";

    const windowHrefChanger = () => {
      if (paths[0] === "comments") {
        window_location = "Відгуки";
      } else if (paths[0] === "contacts") {
        window_location = "Контакти";
      } else if (paths[0] === "autodiagnostic") {
        window_location = "Автодіагностика";
      } else if (paths[0] === "tehservice") {
        window_location = "Технічне обслуговування";
      } else if (paths[0] === "electric") {
        window_location = "Автоелектрика";
      } else if (paths[0] === "hodovaya") {
        window_location = "Ремонт ходової";
      } else if (paths[0] === "otherservices") {
        window_location = "Інші послуги автосервісу";
      } else if (paths[0] === "autoconditioner") {
        window_location = "Автокондиціонер";
      } else if (paths[0] === "tirefitting") {
        window_location = "Шиномонтаж";
      } else if (paths[0] === "rozval") {
        window_location = "Розвал-сходження 3D";
      } else if (paths[0] === "engine") {
        window_location = "Ремон та обслуговування двигуна";
      } else if (paths[0] === "tehfluids") {
        window_location = "Заміна технічних рідин та фільтрів";
      } else if (paths[0] === "braksystem") {
        window_location = "Гальмівна система";
      } else if (paths[0] === "steering") {
        window_location = "Рульове управління";
      } else {
        window_location = "";
      }
    };

    windowHrefChanger();
    setWindowLocHref(window_location);
  }, [windowPath]);

  return (
    <>
      <BrowserRouter>
        <ScrollToTop />
        <Navbar />
        <LinksBar
          href={href}
          setWindowLocHref={setWindowLocHref}
          windowLocHref={windowLocHref}
          setWindowPath={setWindowPath}
        />
        <Routes>
          <Route exact path="/sto-website" element={<Main />} />
          <Route exact path="/contacts" element={<Contacts />} />
          <Route exact path="/hodovaya" element={<HodovayaFix />} />
          <Route exact path="/autodiagnostic" element={<AutoDiagnostic />} />
          <Route exact path="/tehservice" element={<TehService />} />
          <Route exact path="/otherservices" element={<OtherServices />} />
          <Route exact path="/comments" element={<CommentForm />} />
          <Route exact path="/autoconditioner" element={<AutoConditioner />} />
          <Route exact path="/tirefitting" element={<TireFitting />} />
          <Route exact path="/rozval" element={<Rozval />} />
          <Route exact path="/engine" element={<Engine />} />
          <Route exact path="/tehfluids" element={<TehFluids />} />
          <Route exact path="/braksystem" element={<BrakSystem />} />
          <Route exact path="/steering" element={<Steering />} />
          <Route exact path={service_path} element={<Services />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </>
  );
};

export default AppRoutes;
